pub enum FormPart {
    Text(String),
    File {
        file: FilePart,
        mime: Option<String>,
        file_name: Option<String>,
    },
}

pub enum WindowEvent {
    Resized(PhysicalSize<u32>),
    Moved(PhysicalPosition<i32>),
    CloseRequested {
        api: CloseRequestApi,
    },
    Destroyed,
    Focused(bool),
    ScaleFactorChanged {
        scale_factor: f64,
        new_inner_size: PhysicalSize<u32>,
    },
    FileDrop(FileDropEvent),
    ThemeChanged(Theme),
}

pub enum RunEvent {
    Exit,
    ExitRequested {
        api: ExitRequestApi,
    },
    WindowEvent {
        label: String,
        event: WindowEvent,
    },
    Ready,
    Resumed,
    MainEventsCleared,
}

pub enum IconDto {
    Rgba {
        rgba: Vec<u8>,
        width: u32,
        height: u32,
    },
}

pub enum Icon {
    Rgba {
        rgba: Vec<u8>,
        width: u32,
        height: u32,
    },
}

pub enum RuntimeOrDispatch<'r, R: Runtime> {
    Runtime(&'r R),
    RuntimeHandle(R::Handle),
    Dispatch(R::Dispatcher),
}
